MongoDB Aggregation Pipeline : conditionnal multiplication<p>I'm writing a query on a mongoDB database that monitors some AWS Batch activity, but unfortunately the types of the field <code>updated_at</code> are not consistent.   ​</p>
<p>If the Field <code>status</code> is <code>submitted</code>, the type is <code>datetime.datetime</code> (ex : <code>2022-01-17T15:13:34.929+00:00</code>), if the <code>status</code> is <code>succeeded</code> the type is <code>time.time</code> (ex : <code>1642434736</code>, number of <strong>seconds</strong> since 1st January 1970).</p>
<p>As I cannot convert an <code>int</code> number to a date directly (I would need a double or another type) [<a href="https://docs.mongodb.com/manual/reference/operator/aggregation/toDate/#:%7E:text=The%20following%20table%20lists%20the%20input%20types%20that%20can%20be%20converted%20to%20a%20date%3A" rel="nofollow noreferrer">source</a>], I need to convert the Date to a number, here's how I did it :</p>
<pre><code>db.topic_scorings.aggregate([   
    ​{
       ​$addFields: {
           ​timeSeconds: {
               ​$convert: {
                   ​input: &quot;updated_at&quot;,
                   ​to: &quot;double&quot;,
                   ​onNull: &quot;$updated_at&quot;,
                   ​onError: &quot;$updated_at&quot;
               ​}
           ​}
       ​}
   ​}
])
</code></pre>
<p>But the issue is that the documents with type <code>int</code> keep the same value (number of <strong>seconds</strong> from epoch, just converted to type <code>double</code>), and the documents with type <code>datetime.datetime</code> are converted to type double, as the number of <strong>milliseconds</strong> since the 1st January 1970.<br />
So my question is :</p>
<ul>
<li>How can I multiply the <code>updated_at</code> Field based on the value of the <code>status</code> Field ?</li>
</ul>

