How to update a mongodb document depending on values of document referenced by its objectId<p>How can I update a MongoDB document depending on values of document referenced by it's objectId? (I am using MongoDB via mongoose)</p>
<p>Let's assume I have two collections. One is called competitions and the other one is called games. A competition can have several games in it. See code example below</p>
<pre><code>// competition documents
[
    {
        compeititionName:&quot;myCompetition&quot;,
        games:[&quot;617...b16&quot;, &quot;617...b19&quot;, &quot;617...b1c&quot;,
        competitionStatus:&quot;notStarted&quot;,
    },
    {
        compeititionName:&quot;yourCompetition&quot;,
        games:[&quot;617...b18&quot;, &quot;617...b19&quot;, &quot;617...b1c&quot;,
        competitionStatus:&quot;playing&quot;,
    },
    {
        compeititionName:&quot;ourCompetition&quot;,
        games:[&quot;617...b14&quot;, &quot;617...b19&quot;, &quot;617...b2b&quot;,
        competitionStatus:&quot;ended&quot;,
    }

]
</code></pre>
<p>The <code>competitionStatus</code> above is dependent on the status of the games in that competition.</p>
<p>If all the games have not started then the competition should have <code>notStarted</code> as its <code>competitionStatus</code>. However if any of the games is being played or there are games which have not started and others which are complete then the competition status should be <code>playing</code>. Finally if all the games have ended the the competition status should be <code>ended</code>. An example of how the games collection would look is:</p>
<pre><code>// game documents
[
    {
        _id:&quot;617...b16&quot;,
        gameStatus:&quot;notStarted&quot;
    },
    {
        _id:&quot;617...b18&quot;,
        gameStatus:&quot;playing&quot;
    },
    {
        _id:&quot;617...b14&quot;,
        gameStatus:&quot;ended&quot;
    },
]
</code></pre>
<p>How can I update the <code>competitionStatus</code> given the <code>_id</code> of the game whose status has just changed?</p>

